  render() {
    return (
      <Router>
        <div>
          <div id="main">
            <div className="site-section site-portfolio">
              <div className="container">
                <Header />

                <Switch>
                  <Route path="/:handle" component={AllNews} ></Route>
                </Switch>
              </div>
            </div>

            <About />  
          </div>

          <Footer />
        </div>
      </Router>
    );
  }

}

export default App;
